import Card from "../card/card.js"
import "./trending.css"


const Trending = ({trendingNfts}) => {

    const displayArray = trendingNfts.map((obj,i) => {
        let element;
        if (i < 8) {
            // axios
            //     .get(`${url}${obj.id}`)
            //     .then(response => {
            //         console.log(response.data)
            //     })
            // console.log('i fire once')
            element =
                <Card
                    key={obj.id}
                    title={obj.name}
                />
        }
        return element
    })

    return(
        <div className="trending">
                {displayArray}
        </div>
    )
}

export default Trending;
